import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';

export class Error extends Component {
    render() {
        return (
            <React.Fragment>
                <div class="container-fluid p-0">
                    <section class="resume-section" id="category">
                        <div class="resume-section-content">
                            <h1>
                                Oops!</h1>
                            <h2>
                                404 Not Found</h2>
                            <div class="error-details">
                                Sorry, an error has occured, Requested page not found!
                            </div>
                            <div class="error-actions">
                                <NavLink to='/' class="btn bg-primary text-dark btn-lg">
                                    Take Me Home </NavLink>
                                {/* <a href="http://www.jquery2dotnet.com" class="btn btn-default btn-lg"><span class="glyphicon glyphicon-envelope"></span> Contact Support </a> */}
                            </div>
                        </div>
                    </section>
                </div>
            </React.Fragment>
        )
    }
}

export default Error;
